jQuery(document).ready(function(){jQuery("a.bumper").on("click",function(d){var b=$(this).attr("href"),e=$(this).data("casinoid"),f=$(this).data("country");if(/\/goto\//.test(b)){d.preventDefault();var a=window.open(b,"_blank");$.ajax({type:"GET",data:{action:"bumper_page",link:b,casinoid:e,country:f},url:ajaxscripts.ajax_url,dataType:"html",success:function(c){a.document.open();a.document.write(c);a.document.close();a.focus()},error:function(c,h,g){console.log(c.responseText);console.log(g)}})}})});
